/**
 * The Class BankDetails.
 */
public class BankDetails {

	/** The bank name. */
	private String bankName;

	/** The acct holder name. */
	private String acctHolderName;

	/** The acc number. */
	private long accNumber;

	/**
	 * Gets the bank name.
	 *
	 * @return the bank name
	 */
	public String getBankName() {
		return bankName;
	}

	/**
	 * Sets the bank name.
	 *
	 * @param bankName the new bank name
	 */
	public void setBankName(String bankName) {
		this.bankName = bankName;
	}

	/**
	 * Gets the acct holder name.
	 *
	 * @return the acct holder name
	 */
	public String getAcctHolderName() {
		return acctHolderName;
	}

	/**
	 * Sets the acct holder name.
	 *
	 * @param acctHolderName the new acct holder name
	 */
	public void setAcctHolderName(String acctHolderName) {
		this.acctHolderName = acctHolderName;
	}

	/**
	 * Gets the acc number.
	 *
	 * @return the acc number
	 */
	public long getAccNumber() {
		return accNumber;
	}

	/**
	 * Sets the acc number.
	 *
	 * @param accNumber the new acc number
	 */
	public void setAccNumber(long accNumber) {
		this.accNumber = accNumber;
	}

}
